function extractId(row){ let id=""; if(ID_COL&&row[ID_COL]) id=String(row[ID_COL]).trim(); if(!id&&NICK_COL&&row[NICK_COL]){ const m=String(row[NICK_COL]).match(/\(([-\w\.]+)\)\s*$/); if(m) id=m[1]; } return id; }
function buildMainTabs(){ const wrap=document.getElementById("mainTabs"); wrap.innerHTML=""; ["누적후원랭킹","참여율랭킹","회차별목록"].forEach(name=>{ const btn=document.createElement("button"); btn.className="tab"; btn.textContent=name; btn.addEventListener("click",()=>setMainTab(name)); if(name===currentMainTab) btn.classList.add("active"); wrap.appendChild(btn); }); }
function setMainTab(name){ currentMainTab=name; document.querySelectorAll("#mainTabs .tab").forEach(t=>t.classList.toggle("active",t.textContent===name)); document.getElementById("sessionTabs").classList.toggle("show", name==="회차별목록"); applyView(); }
function buildSessionTabs(){ const wrap=document.getElementById("sessionTabs"); wrap.innerHTML=""; SESSION_COLS.forEach(col=>{ const btn=document.createElement("button"); btn.className="session-tab"; btn.textContent=col; btn.addEventListener("click",()=>{ currentSession=col; highlightSession(col); applyView(); }); wrap.appendChild(btn); }); highlightSession(currentSession); }
function highlightSession(col){ document.querySelectorAll("#sessionTabs .session-tab").forEach(t=>t.classList.toggle("active", t.textContent===col)); }
function th(label, cls){ const el=document.createElement("th"); el.textContent=label; if(cls) el.className=cls; return el; }
function buildHeader(labels){ const thead=document.querySelector("thead tr"); thead.innerHTML=""; labels.forEach(([label,cls])=>thead.appendChild(th(label,cls))); }
function addRank(rows,getVal){ rows.sort((a,b)=> (getVal(b)-getVal(a))); rows.forEach((r,i)=>r.__rank=i+1); return rows; }
function buildNickCell(row){ const wrap=document.createElement("div"); wrap.className="nick-wrap"; const nick=String(row[NICK_COL]??""); const id=extractId(row); const span=document.createElement("span"); span.className="nick-text"; span.title=nick+(id? " ("+id+")": ""); span.textContent=nick+(id? " ("+id+")": ""); wrap.appendChild(span); if(id){ const a=document.createElement("a"); a.href="https://www.sooplive.co.kr/station/"+encodeURIComponent(id); a.target="_blank"; a.rel="noopener"; const img=document.createElement("img"); img.src="./soop_logo_dark.svg"; img.alt="SOOP"; img.className="soop-logo"; a.appendChild(img); wrap.appendChild(a); } return wrap; }
function buildDetailsContent(row){ const div=document.createElement("div"); div.className="detail-list"; (SESSION_COLS||[]).forEach(c=>{ const n=numVal(row[c]); if(!Number.isNaN(n)&&n>0){ const item=document.createElement("div"); item.className="detail-item"; const k=document.createElement("div"); k.className="detail-key"; k.textContent=c+":"; const val=document.createElement("div"); val.className="detail-val"; val.textContent=n.toLocaleString(); item.appendChild(k); item.appendChild(val); div.appendChild(item); }}); if(!div.children.length){ const none=document.createElement("div"); none.textContent="회차별 기록 없음"; div.appendChild(none); } return div; }
function toggleDetails(tr,row,colspan,btn){ const next=tr.nextElementSibling; const closing=(next&&next.classList.contains("details-row")); if(closing) next.remove(); else { const detailsTr=document.createElement("tr"); detailsTr.className="details-row"; const td=document.createElement("td"); td.colSpan=colspan; td.appendChild(buildDetailsContent(row)); detailsTr.appendChild(td); tr.after(detailsTr); } if(btn){ btn.dataset.state=(!closing?"open":"closed"); btn.textContent=(!closing?"▲":"▼"); btn.setAttribute("aria-expanded", String(!closing)); } }
function makeExpandButton(onClick){ const btn=document.createElement("button"); btn.className="expand-btn"; btn.type="button"; btn.setAttribute("aria-expanded","false"); btn.textContent="▼"; btn.addEventListener("click",onClick); return btn; }
function viewTotal(){ const labels=[["순위","rank"],["닉네임(아이디)","nick"],["총후원개수","val"],["참여횟수","cnt"],["참여율","rate"]]; buildHeader(labels); const usable=DATA.filter(r=> r[NICK_COL] && r[TOTAL_COL]!=null && r[TOTAL_COL] !== ""); const ranked=addRank([...usable], r=> numVal(r[TOTAL_COL])); renderRows(ranked, ["__rank","nick",TOTAL_COL,CNT_COL,RATE_COL], 2, 5); }
function viewRate(){ const labels=[["순위","rank"],["닉네임(아이디)","nick"],["참여율","rate"],["참여횟수","cnt"],["총후원개수","val"]]; buildHeader(labels); const usable=DATA.filter(r=> r[NICK_COL] && r[RATE_COL]!=null && r[RATE_COL] !== ""); const ranked=addRank([...usable], r=> parsePercent(r[RATE_COL])); renderRows(ranked, ["__rank","nick",RATE_COL,CNT_COL,TOTAL_COL], 4, 5); }
function viewSession(){ const labels=[["순위","rank"],["닉네임(아이디)","nick"],[currentSession||"회차","val"]]; buildHeader(labels); const usable=DATA.filter(r=> r[NICK_COL] && !Number.isNaN(numVal(r[currentSession])) && numVal(r[currentSession])>0); const ranked=addRank([...usable], r=> numVal(r[currentSession])); renderRows(ranked, ["__rank","nick",currentSession], null, 3); }
function renderRows(rows,keys,expandOnIdx,colspan){ const tbody=document.querySelector("tbody"); tbody.innerHTML=""; rows.forEach(row=>{ const tr=document.createElement("tr"); keys.forEach((key,idx)=>{ const td=document.createElement("td"); if(idx===0) td.className="rank"; if(idx===1) td.className="nick"; if(idx>=2) td.className=(idx===2?"val":(idx===3?"cnt":"rate")); if(key==="nick") td.appendChild(buildNickCell(row)); else if(key==="__rank") td.textContent=row.__rank??""; else { const isRate=(key===RATE_COL); const text=isRate? (isNaN(parsePercent(row[key]))? String(row[key]??""): parsePercent(row[key]).toLocaleString()+"%") : fmtNumber(row[key]); td.textContent=text; } if(expandOnIdx!==null && idx===expandOnIdx && keys[idx]===TOTAL_COL){ const btn=makeExpandButton(()=>toggleDetails(tr,row,colspan,btn)); td.appendChild(btn); } tr.appendChild(td); }); tbody.appendChild(tr); }); document.getElementById("rowCount").textContent = rows.length.toLocaleString(); }
function applyView(){ document.getElementById("sessionTabs").classList.toggle("show", currentMainTab==="회차별목록"); if(currentMainTab==="누적후원랭킹") viewTotal(); else if(currentMainTab==="참여율랭킹") viewRate(); else viewSession(); }
function init(){ buildMainTabs(); buildSessionTabs(); applyView(); }
window.addEventListener("DOMContentLoaded", init);
<!-- script.js 내부: SEARCH INJECT 블록 교체 -->
// ====== [SEARCH INJECT START] 탭 아래 자동 검색창 + 필터 (닉네임/아이디 한정) ======
(function(){
  // 1) 검색 스타일 주입
  const STYLE_ID = 'search-style-autoinject';
  if (!document.getElementById(STYLE_ID)) {
    const css = `
      .searchbar{
        display:flex;align-items:center;gap:8px;
        background:#fff;border:1px solid var(--border);
        border-radius:12px;padding:8px 10px;
        box-shadow:0 4px 10px rgba(255,133,192,.10);
      }
      .searchbar input{
        flex:1;border:0;outline:none;font-size:13px;
        background:transparent;color:var(--text);
      }
      .searchbar .clear{
        border:0;background:#fff;border:1px solid var(--border);
        border-radius:999px;padding:5px 9px;
        font-weight:700;font-size:11px;color:var(--muted);cursor:pointer;
      }
      .search-info{font-size:11px;color:var(--muted)}
      .hidden{display:none !important}
    `;
    const styleEl = document.createElement('style');
    styleEl.id = STYLE_ID;
    styleEl.appendChild(document.createTextNode(css));
    document.head.appendChild(styleEl);
  }

  // 2) DOM 준비: 세션 탭 아래 검색 UI 삽입
  const sessionTabs = document.getElementById('sessionTabs');
  const anchor = sessionTabs || document.querySelector('#mainTabs') || document.body;

  if (!document.getElementById('searchInput')) {
    const wrap = document.createElement('div');
    wrap.innerHTML = `
      <div class="searchbar" role="search" aria-label="랭킹 검색" style="margin-top:6px;margin-bottom:8px">
        <input id="searchInput" type="search"
               placeholder="닉네임·아이디만 검색 (스페이스=AND) / ESC=초기화"
               autocomplete="off" />
        <button class="clear" id="clearBtn" title="검색 지우기">지우기</button>
      </div>
      <div class="search-info" id="searchInfo" style="margin:6px 2px 10px">전체 항목 표시 중 (닉네임/아이디만 대상)</div>
    `;
    anchor.insertAdjacentElement('afterend', wrap);
  }

  // 3) 요소 핸들
  const $input = document.getElementById('searchInput');
  const $clear = document.getElementById('clearBtn');
  const $info  = document.getElementById('searchInfo');
  const $rowCount = document.getElementById('rowCount');

  // ★ 표 요소를 '매번' 최신으로 다시 가져오게 변경
  const getTableParts = () => {
    const table = document.querySelector('.card table');
    return {
      table,
      thead: table ? table.tHead : null,
      tbody: table ? table.tBodies[0] : null,
    };
  };

  // 공통 유틸
  const norm = (s)=> (s||'').toString()
    .normalize('NFKD')
    .replace(/\s+/g,' ')
    .toLowerCase()
    .trim();

  const updateCount = ()=> {
    const {tbody} = getTableParts();
    if (!$rowCount || !tbody) return;
    const visible = [...tbody.rows].filter(r=>!r.classList.contains('hidden')).length;
    $rowCount.textContent = String(visible);
  };

  // 닉네임/아이디 컬럼 인덱스 찾기 (매 호출 시 최신 헤더 사용)
  const findColumnIndexes = ()=>{
    const {thead} = getTableParts();
    if (!thead || !thead.rows.length) return {idxNick:-1, idxId:-1};
    const ths = [...thead.rows[0].cells].map((th,i)=>({i, text: norm(th.textContent)}));
    const nick = ths.find(th => th.text.includes('닉네임')); // “닉네임(최근)” 대응
    const id   = ths.find(th => th.text.includes('아이디'));
    return { idxNick: nick ? nick.i : -1, idxId: id ? id.i : -1 };
  };

  const buildHayFromRow = (tr, idxNick, idxId)=>{
    const cells = tr.cells;
    const parts = [];
    if (idxNick >= 0 && cells[idxNick]) parts.push(cells[idxNick].textContent);
    if (idxId   >= 0 && cells[idxId])   parts.push(cells[idxId].textContent);
    return norm(parts.join(' '));
  };

  // 메인 필터
  const filter = () => {
    const {tbody} = getTableParts();
    if (!tbody) return;
    const q = norm($input.value);
    const terms = q.split(' ').filter(Boolean); // 공백 = AND

    const {idxNick, idxId} = findColumnIndexes();

    [...tbody.rows].forEach(tr=>{
      if (!terms.length) { tr.classList.remove('hidden'); return; }
      const hay = buildHayFromRow(tr, idxNick, idxId); // 닉네임/아이디만
      const ok = terms.every(t=> hay.includes(t));
      tr.classList.toggle('hidden', !ok);
    });

    $info.textContent = terms.length
      ? `"${$input.value}" (닉네임/아이디)로 필터링됨 (스페이스 = AND)`
      : '전체 항목 표시 중 (닉네임/아이디만 대상)';

    updateCount();
  };

  const onEscClear = (e) => {
    if (e.key === 'Escape') {
      $input.value = '';
      filter();
    }
  };

  // 표 렌더 완료 대기 (렌더 전에도 참조 갱신되도록 테이블을 '그때그때' 가져오므로 간단)
  const waitUntilRows = () => new Promise(resolve=>{
    let tries=0;
    const t = setInterval(()=>{
      const {tbody} = getTableParts();
      tries++;
      if (tbody && tbody.rows.length) { clearInterval(t); resolve(); }
      if (tries > 100) { clearInterval(t); resolve(); } // failsafe
    }, 80);
  });

  // 탭 전환 등으로 헤더/바디가 바뀔 수 있으므로 MutationObserver로 안전장치
  const observeTable = ()=>{
    const {table} = getTableParts();
    if (!table) return;
    const mo = new MutationObserver(()=>{ filter(); });
    mo.observe(table, {childList:true, subtree:true, characterData:true});
  };

  waitUntilRows().then(()=>{
    updateCount();
    observeTable();
    $input.addEventListener('input', filter);
    $input.addEventListener('keydown', onEscClear);
    $clear.addEventListener('click', ()=>{ $input.value=''; $input.focus(); filter(); });
    // 초기 1회 실행
    filter();
  });
})();
// ====== [SEARCH INJECT END] ======

